            $('#cc-nb-title').text('çerez başlık');
            $('#cc-nb-text').text('');
            $('#cc-nb-text').html('<a href="/en/cookie-policy">This site uses cookies. Read our <u>Cookie Policy</u>. Set your preference here. If you are happy with the use of cookies, please click accept.</a>');

            $('.cc-nb-okagree').text('ACCEPT ALL');
            $('.cc-nb-reject').text('REJECT All');
            $('.cc-nb-changep').text('SETTINGS');
