$(document).ready(function () {

    $('.home-slider').slick({
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        fade:true,
        arrows:false,
        autoplay:true,
        dots:true
    });
    $('.home-slider').on('afterChange', function( prevSlide){
        $('.home-slider img').removeClass('active');
        $('.home-slider img').attr('aria-hidden','true');
    });

    $('.home-slider').on('afterChange', function( currentSlide){
        $('.home-slider .slick-current img').addClass('active');
        $('.home-slider .slick-current img').attr('aria-hidden','false');
    });

    $('.home-slider .slick-current img').addClass('active');
    $('.home-slider .slick-current img').attr('aria-hidden','false');
    
    $('section .box6 .video img,section .box6 .video .play').click(function () {
        $('section .box6 .video img,section .box6 .video .play,section .box6 .video i').remove();
        $('section .box6 .video iframe').show();
        $("iframe")[0].src += "?autoplay=1";
        var iframe = $('.video').find('iframe').attr('data-src');
        $('.video').find('iframe').attr('src',iframe);
    })


}) 
